import '../App.css';
import Header from "../header/Header";
import { GoogleMap } from 'google-maps-react';

function map() {
  return (
    <GoogleMap defaultZoom={10} />
  )
}

const Dashboard = () => {
  return (
    <>
      <Header />
    </>
  );
}

export default Dashboard;
